      | 365459 -> { ItemTypeData.id= 365459; name= "'Zerofrost' Kaalakiota Rail Rifle"; published= false; description= "Part of Kaalakiota’s Stahl line of weaponry, the rail rifle is a fast-firing precision weapon designed for field operations where penetrative power and range are paramount. Developed using the corporation’s proprietary microscale technology, the rail rifle solves oversaturation issues endemic to sustained fire electromagnetic weaponry.  However, its greater range and power are offset by a smaller magazine capacity and lower rate of fire than similarly classified weapons.    The foregrip design aids stabilization and remains cool to the touch even during prolonged discharge where the barrel can exceed mean operating temperatures. Featuring a reinforced subassembly and compact, heavy-barrel design, the rail rifle is the premier fully automatic microscale weapon available today."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365944 -> { ItemTypeData.id= 365944; name= "'Nullarbor' Myron"; published= false; description= "NOTE: In addition to pre-requisite skills, this pre-fitted vehicle requires PG/CPU optimization skills to be trained in order to be used.    The dropship is a two-engine VTOL craft that combines advances in shielded hardware, redundant software protocols, and networked aeronautics into a heavily armored tactical platform capable of insertion and extraction in even the most hostile situations. Its standard five-man carrying capacity, dual hardpoints, and reinforced plating allow it to operate independently in any situation, alternately tracking and engaging enemy targets and ferrying troops into and out of harm's way."; marketGroupId= None; groupId= 351210; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366235 -> { ItemTypeData.id= 366235; name= "Faction Booster Caldari (3-Day)"; published= false; description= "Faction boosters are biometric identification chips issued by major factions throughout New Eden. Once activated they uniquely identify the user as a supporter of the issuing faction. Corporations operating on behalf of the faction will then be authorized to increase rewards to that individual."; marketGroupId= None; groupId= 354641; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1.000000; volume= 0.000000 } |> Some
      | 366429 -> { ItemTypeData.id= 366429; name= "Imperial Laser Rifle"; published= false; description= "The laser rifle is a continuous wave, medium range weapon. Targets are ‘painted’ with a high intensity beam that deals sustained, focused damage in a concentrated area to maximize damage potential.  At the core of the weapon is the thermal cavity, within which an optic spacer converges and blends three individually pumped beams into a single coherent output. The additional distortion introduced by each beam results in weakened output at close range, but as the weapon warms up to mean operating temperature the wavelength stabilizes and the damage output increases significantly, producing a weapon of unmatched precision and lethality in mid-range combat.  Heat build-up is typically managed by a self-regulating failsafe, a device used to forcibly shut the weapon off at regular intervals, flushing heat from its internal workings and preventing lethal feedback to the user, but most laser rifles in the field have been altered to bypass the built-in safety protocols."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366526 -> { ItemTypeData.id= 366526; name= "State Nanohive"; published= false; description= "The nanohive is one of the most advanced pieces of battlefield technology to date, able to convert formatted matter from its limited internal stores and reorganize it into any kind of ammunition. When a soldier approaches, the nanohive receives an automated request from the Cortex Holographic Interface instructing swarms of self-replicating construction nanites to begin producing whatever type of ammunition that soldier requires.  The device itself is composed of three major parts: a composite carbon polymer shell, heavily shielded to prevent potentially disruptive ambient electronic interference; a low-level replicator assembly housing the initial seed swarm; and a C11 power core capable of producing class-one containment fields, confining the nanite swarm as it replicates to its maximum sustainable mass. There is, however, no central computer; each nanite is born with a complete set of instructions on how to create every known variety of ammunition round."; marketGroupId= None; groupId= 351844; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366720 -> { ItemTypeData.id= 366720; name= "'Neo' Commando G/1-Series"; published= false; description= "The Commando dropsuit is a variable combat unit capable of reacting to battlefield threats as they emerge. Built using a repurposed heavy frame, the suit is designed for maximum offensive flexibility. The streamlined frame does away with extraneous armor layers, using the augmented power of the exoskeleton to instead shoulder the weight and bulk of two light-class weapons.    Modified to better interface with light-class blaster weaponry, the Gallente Commando’s subframe regulates the weapon’s cyclotron output, improving plasma compression and enhancing the magnetic acceleration of the produced discharge with devastating results.    The Commando is the ultimate suppression fighter. What the suit sacrifices in tactical versatility, it more than makes up for with flexible weapon loadouts that can counter any of the myriad threats an ever-evolving battlefield may present."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
