      | 47105 -> { ItemTypeData.id= 47105; name= "Cerberus  Blaze  Squadron SKIN (Permanent)"; published= true; description= "Designed by Angel Cartel engineers, and released as a tribute to the leader of the Dominations' notorious  Blaze  hit and run squadron who was lost in battle in late YC119, this nanocoating was made available in very limited numbers for only six hulls.     Known only as  Blaze , a name earned from both the trail of burning wreckage usually left in his wake and his appearance with a golden red beard, his squadron became his namesake after hundreds of daring raids against Republic Fleet assets.    Today, they wear his colors in honor of his legacy as one of the Angel Cartel’s most successful and notorious pirates.     Gone, but never forgotten. His name lives on in all of you. Hoist his colors, and decimate anything that stands in your way.     Trald Vukenda – CEO, Dominations."; marketGroupId= Some(2070); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
