      | 47299 -> { ItemTypeData.id= 47299; name= "Decayed 500MN Microwarpdrive Mutaplasmid"; published= true; description= "This bioadaptive mutaplasmid tool is designed to interface with and alter propulsion systems that combine impulse thrust with localized warp field transformations. As such this mutaplasmid could be used to mutate the performance characteristics of most microwarpdrives in the correct size class.    Triglavian bioadaptive technology makes extensive use of engineered colonies of extremophilic bacteria, that are used to grow, harvest and adapt various resources found in Abyssal Deadspace. Artificial colonizing plasmids integrated into specialist tools used for direct adaptation of technology can be found in Triglavian caches in various stages of development. These mutaplasmids can be used to alter the characteristics of a wide variety of equipment types, depending on the strain and the bioadaptive tool with which they are integrated.    The mutaplasmid colony integrated into this bioadaptive tool has begun to decay and mutation effects will be less pronounced as a result. While possible mutational benefits are low, the risks of using this mutaplasmid are also reduced.  "; marketGroupId= Some(2452); groupId= 1964; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
      | 47396 -> { ItemTypeData.id= 47396; name= "Expired Advanced 'Guri Hivaa' Cerebral Accelerator"; published= true; description= "The Guri Hivaa are Guristas pilots specializing in hunting for very specific targets, whether that be marks to kill or kidnap, or rare and valuable consignments to plunder. They use cerebral accelerator technology to assist them in developing their specialized hunting skills.    Cerebral accelerators are military grade boosters that significantly increase a pilot's skill development for a given window of time. This is achieved by priming the user's brain and neural pathways for increased data bandwidth during knowledge transfer.    Capsuleers using this accelerator can expect a massive increase in neural bandwidth, aiding much more rapid transfer of neural data from skill packs.    The only drawback to this accelerator is that capsuleer training renders it ineffective after one use. It will cease to function after 24 hours once activated, due to natural degradation of the biochemical compounds used to stimulate the user’s neural activity. Heightened knowledge of <url=showinfo:3405>Biology</url> will increase this time up to 48 hours.    The compounds are only guaranteed to function until YC 120.04.24."; marketGroupId= None; groupId= 303; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 2422; value= 17645.458333 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 330; value= 86400000.000000 }; { DogmaAttributeValueData.attributeId = 1890; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 175; value= 12.000000 }; { DogmaAttributeValueData.attributeId = 176; value= 12.000000 }; { DogmaAttributeValueData.attributeId = 177; value= 12.000000 }; { DogmaAttributeValueData.attributeId